B.I4=new A.by("1. WHAT INFORMATION DO WE COLLECT?",null,B.aK,null,null,null)
B.In=new A.by("Personal information you disclose to us \n In Short: We collect personal information that you provide to us.\n We collect personal information that you voluntarily provide to us when you register on the App, express an interest in obtaining information about us or our products and Services, when you participate in activities on the App (such as by posting messages in our online forums or entering competitions, contests orgiveaways) or otherwise when you contact us.\n The personal information that we collect depends on the context of your interactions with us and the App, the choices you make and the products and features you use. The personal information we collect may include the following:\nPersonal Information Provided by You. We collect email addresses; names; passwords; and other similar information.\n All personal information that you provide to us must be true, complete and accurate, and you must notify us of any changes to such personal information.",null,B.ac,null,null,null)
B.I6=new A.by("Information collected through our App\nIn Short: We collect information regarding your push notifications, when you use our App.\nIf you use our App, we also collect the following information:\nPush Notifications. We may request to send you push notifications regarding your account or certain features of the App. If you wish to opt-out from receiving these types of communications, you may turn them off in your device 's settings.\nThis information is primarily needed to maintain the security and operation of our App, for troubleshooting and for our internal analytics and reporting purposes.",null,B.ac,null,null,null)
B.Im=new A.by("2. WILL YOUR INFORMATION BE SHARED WITH ANYONE?",null,B.aK,null,null,null)
B.Ic=new A.by("In Short: We only share information with your consent, to comply with laws, to provide you with services, to protect your rights, or to fulfill business obligations.\nWe may process or share your data that we hold based on the following legal basis:\n  * Consent: We may process your data if you have given us specific consent to use your personal information for a specific purpose.\n  * Legitimate Interests: We may process your data when it is reasonably necessary to achieve our legitimate business interests.\n  * Performance of a Contract: Where we have entered into a contract with you, we may process your personal information to fulfill the terms of our contract.\n  * Legal Obligations: We may disclose your information where we are legally required to do so in order to comply with applicable law, governmental requests, a judicial proceeding, court order, or legal process, such as in response to a court order or a subpoena (including in response to public authorities to meet national security or law enforcement requirements).\n  * Vital Interests: We may disclose your information where we believe it is necessary to investigate, prevent, or take action regarding potential violations of our policies, suspected fraud, situations involving potential threats to the safety of any person and illegal activities, or as evidence in litigation in which we are involved.\nMore specifically, we may need to process your data or share your personal information in the following situations:\n  * Business Transfers. We may share or transfer your information in connection with, or during negotiations of, any merger, sale of company assets, financing, or acquisition of all or a portion of our business to another company.",null,B.ac,null,null,null)
B.Il=new A.by("3. WHAT IS OUR STANCE ON THIRD-PARTY WEBSITES?",null,B.aK,null,null,null)
B.I3=new A.by("In Short: We are not responsible for the safety of any information that you share with third-party providers who advertise, but are not affiliated with, our Website.\nThe App may contain advertisements from third parties that are not affiliated with us and which may link to other websites, online services or mobile applications. We cannot guarantee the safety and privacy of data you provide to any third parties. Any data collected by third parties is not covered by this privacy notice. We are not responsible for the content or privacy and security practices and policies of any third parties, including other websites, services or applications that may be linked to or from the App. You should review the policies of such third parties and contact them directly to respond to your questions.",null,B.ac,null,null,null)
B.Ii=new A.by("4. HOW LONG DO WE KEEP YOUR INFORMATION?",null,B.aK,null,null,null)
B.Ij=new A.by("In Short: We keep your information for as long as necessary to fulfill the purposes outlined in this privacy notice unless otherwise required by law.\nWe will only keep your personal information for as long as it is necessary for the purposes set out in this privacy notice, unless a longer retention period is required or permitted by law (such as tax, accounting or other legal requirements). No purpose in this notice will require us keeping your personal information for longer than the period of time in which users have an account with us.\nWhen we have no ongoing legitimate business need to process your personal information, we will either delete or anonymize such information, or, if this is not possible (for example, because your personal information has been stored in backup archives), then we will securely store your personal information and isolate it from any further processing until deletion is possible.",null,B.ac,null,null,null)
B.Ig=new A.by("5. HOW DO WE KEEP YOUR INFORMATION SAFE?",null,B.aK,null,null,null)
B.Ie=new A.by("In Short: We aim to protect your personal information through a system of organizational and technical security measures.\nWe have implemented appropriate technical and organizational security measures designed to protect the security of any personal information we process. However, despite our safeguards and efforts to secure your information, no electronic transmission over the Internet or information storage technology can be guaranteed to be 100% secure, so we cannot promise or guarantee that hackers, cybercriminals, or other unauthorized third parties will not be able to defeat our security, and improperly collect, access, steal, or modify your information. Although we will do our best to protect your personal information, transmission of personal information to and from our App is at your own risk. You should only access the App within a secure environment.",null,B.ac,null,null,null)
B.Io=new A.by("6. WHAT ARE YOUR PRIVACY RIGHTS?",null,B.aK,null,null,null)
B.Ia=new A.by("In Short: You may review, change, or terminate your account at any time.\nIf you are a resident in the EEA or UK and you believe we are unlawfully processing your personal information, you also have the right to complain to your local data protection supervisory authority. You can find their contact details here: https://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.html.\n If you are a resident in Switzerland, the contact details for the data protection authorities are available here: https://www.edoeb.admin.ch/edoeb/en/home.html.",null,B.ac,null,null,null)
B.I0=new A.by("7. CONTROLS FOR DO-NOT-TRACK FEATURES",null,B.aK,null,null,null)
B.I1=new A.by('Most web browsers and some mobile operating systems and mobile applications include a Do-Not-Track ("DNT") feature or setting you can activate to signal your privacy preference not to have data about your online browsing activities monitored and collected. At this stage no uniform technology standard for recognizing and implementing DNT signals has been finalized. As such, we do not currently respond to DNT browser signals or any other mechanism that automatically communicates your choice not to be tracked online. If a standard for online tracking is adopted that we must follow in the future, we will inform you about that practice in a revised version of this privacy notice.',null,B.ac,null,null,null)
B.Id=new A.by("8. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?",null,B.aK,null,null,null)
B.If=new A.by('In Short: Yes, if you are a resident of California, you are granted specific rights regarding access to your personal information.\nCalifornia Civil Code Section 1798.83, also known as the "Shine The Light" law, permits our users who are California residents to request and obtain from us, once a year and free of charge, information about categories of personal information (if any) we disclosed to third parties for direct marketing purposes and the names and addresses of all third parties with which we shared personal information in the immediately preceding calendar year. If you are a California resident and would like to make such a request, please submit your request in writing to us using the contact information provided below.\n If you are under 18 years of age, reside in California, and have a registered account with the App, you have the right to request removal of unwanted data that you publicly post on the App. To request removal of such data, please contact us using the contact information provided below, and include the email address associated with your account and a statement that you reside in California. We will make sure the data is not publicly displayed on the App, but please be aware that the data may not be completely or comprehensively removed from all our systems (e.g. backups, etc.).',null,B.ac,null,null,null)
B.Ik=new A.by("9. DO WE MAKE UPDATES TO THIS NOTICE?",null,B.aK,null,null,null)
B.I5=new A.by('In Short: Yes, we will update this notice as necessary to stay compliant with relevant laws.\nWe may update this privacy notice from time to time. The updated version will be indicated by an updated "Revised" date and the updated version will be effective as soon as it is accessible. If we make material changes to this privacy notice, we may notify you either by prominently posting a notice of such changes or by directly sending you a notification. We encourage you to review this privacy notice frequently to be informed of how we are protecting your information.',null,B.ac,null,null,null)
